DROP TABLE IF EXISTS `device_info`;
CREATE TABLE `device_info` (
  `SN` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT 'SN（仪器序列号）',
  `DeviceName` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL,
  `SIM` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL,
  `Region` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '省份',
  `Hospital` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '医院名称',
  `Address` varchar(300) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '医院地址',
