  `OEM` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `Agent` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '代理商',
  `ReagentType` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '封闭试剂类型',
  `InstallationArea` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '装机区域',
  `FactoryDate` date DEFAULT NULL COMMENT '出厂日期',
  `InstallDate` date DEFAULT NULL COMMENT '装机日期',
  `SoftVersion` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL,
